export function getBooks() {
    return fetch('/books')
        .then((response) => response.json())
}

export function setBook(book) {
    return fetch('/books/add', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json'
        },
        body: JSON.stringify({ book })
    })
        .then(response => response.json())
}
